messages.content:
Heres a focused review for 325px width. Im going pointbypoint with actionable fixes.

---

## 1) **Layout overflow**
**Issue:** The table extends past the right edge; the HP header and rightmost values are clipped. This is visible in the screenshot (HP column cut off).  
**Fix:** allow horizontal scroll or collapse columns on small screens.

**Option A  horizontal scroll for table**
```css
.table-wrapper {
  overflow-x: auto;
  -webkit-overflow-scrolling: touch;
}
.table-wrapper table {
  min-width: 520px; /* or whatever your desktop table width is */
}
```

**Option B  reduce padding + allow columns to wrap**
```css
table th, table td {
  padding: 12px 8px; /* reduce side padding */
  white-space: nowrap;
}
```

---

## 2) **Touch targets**
**Issue:** Tabs look shorter than 44px height, and the back link is small.  
**Fix:** ensure all interactive elements meet 44x44px.

```css
.tabs button,
.tabs a {
  min-height: 44px;
  padding: 10px 16px;
}

.back-link {
  min-height: 44px;
  display: inline-flex;
  align-items: center;
  padding: 8px 12px;
}
```

---

## 3) **Text readability**
**Issue:** Table body text is borderline small for 325px. The type pill (Trapper) and percentage text read OK, but the name column looks cramped.  
**Fix:** increase base font for table rows.

```css
table td {
  font-size: 16px;
  line-height: 1.4;
}
```

If you want to keep visual density, at least increase `line-height` to avoid cramped names:
```css
table td.name {
  line-height: 1.5;
}
```

---

## 4) **Tab usability at narrow width**
**Issue:** Tabs wrap into two rows (Blankets & More sits alone). Thats fine, but spacing is uneven and alignment looks off.  
**Fix:** stack tabs into a vertical list on narrow screens, or use horizontal scroll.

**Option A  stack**
```css
@media (max-width: 360px) {
  .tabs {
    display: grid;
    grid-template-columns: 1fr;
    gap: 8px;
  }
  .tabs button {
    width: 100%;
  }
}
```

**Option B  horizontal scroll**
```css
@media (max-width: 360px) {
  .tabs {
    display: flex;
    overflow-x: auto;
    gap: 8px;
  }
  .tabs button {
    flex: 0 0 auto;
  }
}
```

---

## 5) **Table usability**
**Issue:** Too many columns for small phones; important info is truncated and user cant compare easily.  
**Fix:** hide less critical columns (like HP) on small screens or convert to card layout.

```css
@media (max-width: 360px) {
  .col-hp, .col-stam-core {
    display: none;
  }
}
```

Alternatively, convert table rows to stacked cards on mobile:
```css
@media (max-width: 360px) {
  table, thead, tbody, th, td, tr { display: block; }
  thead { display: none; }
  tr { padding: 12px 0; border-bottom: 1px solid #2a2a2a; }
}
```

---

## 6) **Visual bugs**
**Issue:** The search inputs orange border looks good, but the caret is too close to the left edge (needs padding).  
**Fix:**
```css
.search-input {
  padding-left: 14px;
}
```

**Issue:** Showing 23 items is floating with little spacing to table header.  
**Fix:**
```css
.items-count {
  margin: 12px 0 8px;
}
```

---

### Quick priority list
1) Fix table overflow/clipping (HP column).  
2) Increase touch target size for tabs/back link.  
3) Make tabs stack or horizontal scroll at small width.  

If you share the actual class names, I can target the exact selectors.
